import React from 'react'
import { imageURL } from '../config/config';

function movieActorList({ actors }) {
    return (
        <div>
            {
                actors.map(actor => (
                    <div>
                        <img src={`${imageURL}/w500/${actors.poster_path}`} />
                        <div>{actor.name}</div>
                    </div>
                ))
            }
        </div>
    )
}

export default movieActorList
